import React from 'react'
import logoImg from '../../../assets/images/logo.png'
import Link from 'react-dom'

const logo =(props)=>(
    <div>
        <Link>
            <img src={logoImg} alt="MyBurger"/>
        </Link>
    </div>
);

export default logo;
